import { CWidgetProgressIcon } from "@coreui/react";
import CIcon from "@coreui/icons-react";
const DWidget = (props) => {
  return (
    <>
      <CWidgetProgressIcon
        header="12"
        text="Total Users"
        color="gradient-danger"
        inverse
      >
        <CIcon name="cil-people"  />
      </CWidgetProgressIcon>
    </>
  );
};
export default DWidget;
